	(10493, 'Admin', 'http://localhost/outbound/panel/bank_soal/insert_detail', 'INSERT Bank_soal with ID = 0 NAME = 131, <p>Soal pilihan ganda</p>\r\n, , <p>Hai, Quipperian!</p>\r\n\r\n<p>Kamu berencana melanjutkan studi ke mana selepas SMA nanti? Pssst, selain PTN dan PTS, sekolah tinggi juga jadi salah satu destinasi favorit untuk melanjutkan studi, lho. Sebut saja, Sekolah Tinggi Akuntansi Negara alias STAN. Eits, jangan salah, meskipun bukan PTN, tetap tidak mudah lho untuk bisa masuk ke sekolah tinggi yang menawarkan empat jurusan ini. Kamu harus berjuang dalam serangkaian ujian&mdash;mulai dari ujian tertulis, ujian kesehatan, hingga ujian wawancara&mdash;bersama dengan ribuan orang lainnya.</p>\r\n\r\n<p>Nah, sama sekali nggak salah, lho, kalau kamu mulai mempersiapkan dirimu sejak sekarang. Berikut, Quipper akan membantumu mempersiapkan diri untuk mengerjakan ujian tulis yang membutuhkan ketelitian tinggi&mdash;ujian matematika!</p>\r\n, pilihan, <p>Seseorang mengendarai mobil ke tempat kerjanya selama 1 jam dengan jarak 30 km. Jika dia terlambat berangkat 10 menit, kecepatan yang harus digunakan agar sampai ke kantor adalah &hellip;</p>\r\n, a, 33 /km, 40 /km, 69 /km, 70 / km', '2020-07-06 20:35:02'),
	(10494, 'Admin', 'http://localhost/outbound/panel/bank_soal/insert_detail', 'INSERT Bank_soal with ID = 0 NAME = 131, <p>Soal pilihan ganda</p>\r\n, , <p>Hai, Quipperian!</p>\r\n\r\n<blockquote>\r\n<p>Kamu berencana melanjutkan studi ke mana selepas SMA nanti? Pssst, selain PTN dan PTS, sekolah tinggi juga jadi salah satu destinasi favorit untuk melanjutkan studi, lho. Sebut saja, Sekolah Tinggi Akuntansi Negara alias STAN. Eits, jangan salah, meskipun bukan PTN, tetap tidak mudah lho untuk bisa masuk ke sekolah tinggi yang menawarkan empat jurusan ini. Kamu harus berjuang dalam serangkaian ujian&mdash;mulai dari ujian tertulis, ujian kesehatan, hingga ujian wawancara&mdash;bersama dengan ribuan orang lainnya.</p>\r\n</blockquote>\r\n\r\n<p>Nah, sama sekali nggak salah, lho, kalau kamu mulai mempersiapkan dirimu sejak sekarang. Berikut, Quipper akan membantumu mempersiapkan diri untuk mengerjakan ujian tulis yang membutuhkan ketelitian tinggi&mdash;ujian matematika!</p>\r\n, pilihan, <p>Seseorang mengendarai mobil ke tempat kerjanya selama 1 jam dengan jarak 30 km. Jika dia terlambat berangkat 10 menit, kecepatan yang harus digunakan agar sampai ke kantor adalah &hellip;</p>\r\n, a, 33 /km, 40 /km, 69 /km, 70 / km', '2020-07-06 20:35:37'),
